import React from 'react'

function RenderingLists() {
  const bookList = [
    "to kill a mockinbird",
    "the great gatsby",
    "the catcher in the rye" 
  ]

  const books = [
    {
      title: "to kill a mockinbird",
      author: "harper lee",
      pages: 281
    },
    {
      title: "the great gatsby",
      author: "f. scott fitzgerald",
      pages: 218
    },
    {
      title: "the catcher in the rye",
      author: "j. d. salinger",
      pages: 234 
    }
  ]

  return (
    <div>
      {bookList.map(book =>{
        return <h2>{book}</h2>
      })}
      <hr />
      {
        books.map(book => {
          return (
            <div>
            <h5>{books.title}</h5>
            <p>{books.author}</p>
            <p>{books.pages}</p>
          </div>
          )
        }
        )
      }
    </div>
  )
}

export default RenderingLists
